import React from "react";

function Table(){
    return (
        <table className="centered-table">
            <thead>
            <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Category</th>
                <th>Amount</th>
            </tr>
            </thead>
        </table>
    )
}

export default Table;
